INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1001, 0, "お！\nあそこに困ってそうな人発見！", 1, 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1, 0, 0, 1, "春咲 ひより");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1002, 0, "大切な人を\n守れるようになりたい…って", 1, 1.4, "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1, 0, 0, 1, "草野 優衣");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1003, 0, "キミに必要な集中力と感性が", 1, 1.4, "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", 0, 0, 1, 0, 0, 1, "士条 怜");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1004, 0, "今日はなにして遊ぶ？", 1, 1.5, "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1, 0, 0, 1, "穂高 みそぎ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1006, 0, "ねぇ…", 1, 1.4, "風宮あかりです", "私といっしょに…\nいかない？", 0, 0, 1, 0, 0, 1, "風宮 あかり");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1007, 0, "プリンたべたいのー", 1, 1.5, "出雲宮子なのー", "食べ物の恨みは怖いのー", 0, 0, 1, 0, 0, 1, "出雲 宮子");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1008, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 1.4, "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", 0, 0, 1, 0, 0, 1, "虹村 雪");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1009, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 1.4, "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", 0, 0, 1, 0, 0, 1, "柊杏奈");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1010, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", 0, 0, 1, 0, 0, 1, "姫宮 真歩");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1011, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 1.4, "衣之咲璃乃です！", "ここで会ったが\n100年目～！", 0, 0, 1, 0, 0, 1, "衣之咲 璃乃");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1012, 0, "ち、超能力って…\n何のことかな～？", 1, 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1, 0, 0, 1, "柏崎 初音");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1016, 0, "一応カリスマ読モJKやってまっす！", 1, 1.4, "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1, 0, 0, 1, "美波 鈴奈");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1017, 0, "東京は遊園地みたいなところさー", 1, 1.4, "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", 0, 0, 1, 0, 0, 1, "喜屋武 香織");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1018, 0, "先生って呼ばれるのは\nくすぐったいから", 1, 1.4, "支倉伊緒です。", "イオちゃんって呼んでね。", 0, 0, 1, 0, 0, 1, "支倉 伊緒");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1020, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", 0, 0, 1, 0, 0, 1, "茜 ミミ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1021, 0, "あの……\nふぇ……", 1, 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", 0, 0, 1, 0, 0, 1, "栗林 くるみ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1022, 0, "こんな私に貴重な時間を\n割いていただき、", 1, 1.4, "風宮よりです。\nあああああ！", "なんてありがとうございます！", 0, 0, 1, 0, 0, 1, "風宮 より");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1023, 0, "おにいちゃんどこいくの？\nえ？", 1, 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", 0, 0, 1, 0, 0, 1, "北条 綾音");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1025, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 1.4, "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", 0, 0, 1, 0, 0, 1, "天野 すずめ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1027, 0, "あなたは…運命の……\n伴侶……", 1, 1.4, "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", 0, 0, 1, 0, 0, 1, "倉石 恵理子");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1028, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", 0, 0, 1, 0, 0, 1, "佐々木 咲恋");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1029, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 1.4, "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", 0, 0, 1, 0, 0, 1, "桜井 望");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1030, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 1.4, "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1, 0, 0, 1, "ニノン・ジュベール");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1031, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 1.4, "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", 0, 0, 1, 0, 0, 1, "上喜 しのぶ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1033, 0, "けんども\nそれには足りないモンが…", 1, 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1, 0, 0, 1, "野戸まひる");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1034, 0, "ちょっと緊張しちゃって…", 1, 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1, 0, 0, 1, "綾瀬 ゆかり");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1036, 0, "知らない人とは話しちゃいけないので", 1, 1.5, "氷川鏡華…です", "これ以上お話しすることは…\nないです！", 0, 0, 1, 0, 0, 1, "氷川 鏡華");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1038, 0, "……あ、アラーム。", 1, 1.4, "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1, 0, 0, 1, "柏崎 栞");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1040, 0, "私、一人も友達がいなくて……", 1, 1.4, "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。", 0, 0, 1, 0, 0, 1, "双葉 碧");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1042, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 1.4, "三角千歌です。", "そう思っています。", 0, 0, 1, 0, 0, 1, "三角 千歌");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1043, 0, "あぁ？\nお前のそいつの仲間か？", 1, 1.4, "安芸真琴だ。", "う、疑ってすまなかったな…", 0, 0, 1, 0, 0, 1, "安芸 真琴");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1044, 0, "生けとし生ける全ての者よ！", 1, 1.4, "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1, 0, 0, 1, "イリヤ・オーンスタイン");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1045, 0, "ぐふふふふ……はっ！", 1, 1.4, "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?", 0, 0, 1, 0, 0, 1, "遠見 空花");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1046, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1, 0, 0, 1, "宮坂たまき");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1048, 0, "それでは早速クエストに…", 1, 1.4, "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1, 0, 0, 1, "大神 美冬");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1049, 0, "クエストもバトルも\n掃除も洗濯も", 1, 1.4, "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1, 0, 0, 1, "星野静流");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1050, 0, "見ての通りの\nセクシー美少女で", 1, 1.5, "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1, 0, 0, 1, "玉泉美咲");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1052, 0, "？？？？", 1, 1.4, "？？？", "？？？？", 0, 0, 1, 0, 0, 1, "リマ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1053, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1.5, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 0, 1, "モニカ・ヴァイスヴィント");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1058, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1.5, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 0, 1, "ペコリーヌ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1059, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1.5, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 0, 1, "コッコロ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 1060, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1.5, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 0, 1, "キャル");
